    private class TextSegment
    extends OpenStringBuilder {
        int pos;

        TextSegment(char[] buffer, int length) {
            super(buffer, length);
            this.pos = 0;
        }

        TextSegment(int size) {
            super(size);
            this.pos = 0;
        }

        void clear() {
            this.reset();
            this.restart();
        }

        void restart() {
            this.pos = 0;
        }

        int nextChar() {
            assert (!this.isRead()) : "Attempting to read past the end of a segment.";
            return this.buf[this.pos++];
        }

        boolean isRead() {
            return this.pos >= this.len;
        }
    }
